INSERT INTO `cms_tree` VALUES (1,1,1,1416084922,1488290614,'Главная страница',NULL,NULL,'','<p>Они поражают нас своей бесконечной преданностью и бескорыстной любовью, необыкновенной красотой и грациозностью, веселым нравом и желанием всегда быть рядом с нами. Взамен они хотят совсем немного &ndash; порцию вкусного корма, наше внимание и ласку. Когда мы теряем их из-за болезней и старости, то вдруг понимаем, что ушел ДРУГ, а не просто кошка, собака или птичка.</p>\r\n\r\n<p>Мы создали этот магазин для своих единомышленников, то есть для тех, кто любит и заботится о своих питомцах, стремится сделать их жизнь разнообразней и комфортней. На нашем сайте вы найдете буквально все необходимое для того, чтобы ваши четвероногие или пернатые друзья ни в чем не нуждались.</p>\r\n',NULL,NULL,'1',0,NULL,0,NULL,'','N','Зоомагазин','','',1,'text','editor',NULL,301,'','',1),(9,1,1,1442576764,1481714746,'Каталог',NULL,NULL,'','','catalog',1,'1/9',1,'catalog',200,NULL,'','Y','','','',5,'text','text',NULL,301,'','',1),(17,1,1,1442577460,1478529199,'Контакты',NULL,NULL,'','<h1 style=\"font-family: Pfdindisplaypro-reg; margin: 0px 0px 20px; color: rgb(14, 14, 14); line-height: normal; font-size: 26px !important;\"><br />\r\n&nbsp;</h1>\r\n','contacts',1,'1/17',1,'contacts',500,NULL,'','Y','Контакты STROYKRAY.RU  +7(980)343-29-15 / г. Воронеж, ул Холмистая 26','Email: info@stroykray.ru','',2,'text','editor',NULL,301,'','contacts',1),(70,1,1,1456996581,1474822351,'Бренды',NULL,NULL,'','','brands',1,'1/70',1,'brands',300,NULL,'','Y','','','',2,'text','text',NULL,301,'','brands',1),(77,1,1,1457010249,1481721726,'Доставка и Оплата',NULL,NULL,'','<p>Стоимость доставки по Москве</p>\r\n\r\n<p>Мы работаем только с доставкой, самовывоз невозможен.</p>\r\n\r\n<p>При заказе от 500р. до 1000р. стоимость доставки 350 руб.</p>\r\n\r\n<p>При заказе от 1000р. до 2000р. стоимость доставки 250 руб.</p>\r\n\r\n<p>При заказе от 2000р. доставка по Москве и в пределах 15км МКАДа - бесплатная</p>\r\n\r\n<p>Доставка свыше 15км от МКАД - 20руб./км* *отсчет километража производится от МКАД</p>\r\n\r\n<p>**&nbsp;расчет километража производится с помощью Яндекс Карты</p>\r\n\r\n<p>Доставка по Москве и Московской области</p>\r\n\r\n<p>Заказ должен быть обязательно предварительно согласован. Оператор свяжется с Вами для подтверждения заказа в рабочее время в течение двух часов. Доставка осуществляется на следующий день после оформления заказа.</p>\r\n\r\n<p>Время доставки - с 12:00 до 23:00 ежедневно. При оформлении заказа указывайте в комментариях удобное для Вас время доставки (интервал не менее 3-х часов).</p>\r\n\r\n<p>В день доставки водитель обязательно связывается с Вами по телефону за 15-20 минут до приезда. Если водитель не сможет до Вас дозвониться, доставка автоматически переносится на следующий день или аннулируется. Если Вы опаздываете, водитель будет ожидать не более 15 минут.</p>\r\n\r\n<p>Доставка на дом</p>\r\n\r\n<p>Доставка осуществляется до квартиры.</p>\r\n\r\n<p>В случае неисправности или отсутствия лифта бесплатный подъем товара осуществляется не более 20кг. и не выше 5-го этажа. Без лифта подъём товара, вес которого превышает 20кг на этаж выше 5-го, оплачивается из расчета 25 рублей за этаж. Доставка в офис Доставка осуществляется до подъезда. Обязательное условие - встреча курьера у подъезда.&nbsp;</p>\r\n','dostavka',1,'1/77',1,'dostavka',600,NULL,'','Y','','','',2,'text','editor',NULL,301,'','',1),(1343,1,1,1460532540,1474822351,'Обратная связь',NULL,NULL,'','','feedback',1,'1/1343',1,'feedback',700,NULL,'','N','','','',2,'text','text',NULL,301,'','feedback',1),(1485,1,1,1471805701,1481721768,'Оптовые продажи',NULL,NULL,'','<p style=\"text-align: center;\"><strong><span style=\"color:#000000;\">Приглашаем к содрудничеству строительные и торговые &nbsp;организации!</span></strong></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p><font color=\"#000000\">Текст</font></p>\r\n','optovyie-prodaji',1,'1/1485',1,'optovyie-prodaji',900,NULL,'','Y','','','',2,'text','editor',NULL,301,'','',1),(1486,1,1,1472740753,1481721787,'Поставщикам',NULL,NULL,'','<p style=\"text-align: center;\"><span style=\"color:#000000;\"><span style=\"font-size:14px;\"><strong>Всегда готовы к выгодному сотрудничеству!</strong></span></span></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p>&nbsp; <span style=\"color:#000000;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Текст</span></p>\r\n','postavschikam',1,'1/1486',1,'postavschikam',1000,NULL,'','Y','','','',2,'text','editor',NULL,301,'','',1),(1570,1,1,1481714130,1481716016,'Собаки',17660,NULL,NULL,NULL,'sobaki',9,'1/9/1570',2,'catalog/sobaki',100,NULL,NULL,'Y',NULL,NULL,NULL,5,'text','text',NULL,301,NULL,NULL,1),(1571,1,1,1481714134,1481714750,'Кошки',17661,NULL,NULL,NULL,'koshki',9,'1/9/1571',2,'catalog/koshki',200,NULL,NULL,'Y',NULL,NULL,NULL,5,'text','text',NULL,301,NULL,NULL,1),(1572,1,1,1481714168,1481714750,'Грызуны',17662,NULL,NULL,NULL,'gryizunyi',9,'1/9/1572',2,'catalog/gryizunyi',300,NULL,NULL,'Y',NULL,NULL,NULL,5,'text','text',NULL,301,NULL,NULL,1),(1573,1,1,1481714172,1481714750,'Птицы',17663,NULL,NULL,NULL,'ptitsyi',9,'1/9/1573',2,'catalog/ptitsyi',400,NULL,NULL,'Y',NULL,NULL,NULL,5,'text','text',NULL,301,NULL,NULL,1),(1574,1,1,1481714178,1481714750,'Рептилии',17664,NULL,NULL,NULL,'reptilii',9,'1/9/1574',2,'catalog/reptilii',500,NULL,NULL,'Y',NULL,NULL,NULL,5,'text','text',NULL,301,NULL,NULL,1),(1575,1,1,1481714190,1481714750,'Рыбки',17665,NULL,NULL,NULL,'ryibki',9,'1/9/1575',2,'catalog/ryibki',600,NULL,NULL,'Y',NULL,NULL,NULL,5,'text','text',NULL,301,NULL,NULL,1),(1576,1,1,1481714208,1481714750,'Ветпатека',17666,NULL,NULL,NULL,'vetpateka',9,'1/9/1576',2,'catalog/vetpateka',800,NULL,NULL,'Y',NULL,NULL,NULL,5,'text','text',NULL,301,NULL,NULL,1),(1577,1,1,1481714746,1481714756,'Лошади',17667,NULL,NULL,NULL,'loshadi',9,'1/9/1577',2,'catalog/loshadi',700,NULL,NULL,'Y',NULL,NULL,NULL,5,'text','text',NULL,301,NULL,NULL,1),(1578,1,1,1481716010,1481721080,'Консервы',17677,NULL,NULL,NULL,'konservyi',1570,'1/9/1570/1578',3,'catalog/sobaki/konservyi',100,NULL,NULL,'Y',NULL,NULL,NULL,5,'text','text',NULL,301,NULL,NULL,1),(1579,1,1,1481716016,1481721103,'Сухой корм',17678,NULL,NULL,NULL,'suhoy-korm',1570,'1/9/1570/1579',3,'catalog/sobaki/suhoy-korm',200,NULL,NULL,'Y',NULL,NULL,NULL,5,'text','text',NULL,301,NULL,NULL,1);
